package com.ceb.hdqs.service.cache;

import java.util.List;
import java.util.concurrent.ConcurrentHashMap;

import com.ceb.bank.context.RowkeyContext;

public class C0771RowkeyItem extends AbstractRowkeyItem {
	/**
	 * 页码与RowKey映射关系
	 */
	private ConcurrentHashMap<Integer, List<RowkeyContext>> cache = new ConcurrentHashMap<Integer, List<RowkeyContext>>();
	private Long bishuu = 0L;
	private String kehuzh;
	private String kehhao;
	private String gerzwm;

	public ConcurrentHashMap<Integer, List<RowkeyContext>> getCache() {
		return cache;
	}

	public void setCache(ConcurrentHashMap<Integer, List<RowkeyContext>> cache) {
		this.cache = cache;
	}

	public Long getBishuu() {
		return bishuu;
	}

	public void setBishuu(Long bishuu) {
		this.bishuu = bishuu;
	}

	public String getKehuzh() {
		return kehuzh;
	}

	public void setKehuzh(String kehuzh) {
		this.kehuzh = kehuzh;
	}

	public String getKehhao() {
		return kehhao;
	}

	public void setKehhao(String kehhao) {
		this.kehhao = kehhao;
	}

	public String getGerzwm() {
		return gerzwm;
	}

	public void setGerzwm(String gerzwm) {
		this.gerzwm = gerzwm;
	}
}